import React from 'react';
import './App.css';
import ToDoApp from './components/ToDoList';
import Header from './components/Header';
function App() {
  return (
    <div className="App">
      <section>
      <Header />
      <ToDoApp />
      </section>
    </div>
  );
}

export default App;
